<p>Er erscheint nur in Blog A, aber in mehreren Kategorien.</p>',
'Second post' => 'Zweiter Eintrag',
'Clean Permalinks!' => 'Saubere Permalinks!',
'b2evolution uses old-style permalinks and feedback links by default. This is to ensure maximum compatibility with various webserver configurations.\n\nNethertheless, once you feel comfortable with b2evolution, you should try activating clean permalinks in the Global Settings &gt; Link options in the admin interface.' => 'b2evolution benutzt standardmässig old-style Permalinks und Feedback-Links. Dies dient zur maximalen Kompatibilität mit verschiedenen Webserver-Konfigurationen.
Nichtsdestotrotz, wenn du dich behaglich im Umgang mit b2evolution fühlst, solltest du versuchen, saubere Permalinks in den Einstellungen einzuschalten (aktiviere \'Benutze Extra-Path Info\')',
'Apache optimization...' => 'Apache Optimierung...',
'In the <code>/blogs</code> folder there is a file called [<code>sample.htaccess</code>]. You should try renaming it to [<code>.htaccess</code>].\n\nThis will optimize the way b2evolution is handled by the webserver (if you are using Apache). This file is not active by default because a few hosts would display an error right away when you try to use it. If this happens to you when you rename the file, just remove it and you\'ll be fine.' => 'Im <code>/blogs</code> Verzeichnis, wie auch in <code>/blogs/admin</code> sind zwei Dateien namens [<code>sample.htaccess</code>]. Du solltest versuchen, diese nach [<code>.htaccess</code>] umzubenennen.

Das wird die Art, wie b2evolution vom Webserver behandelt wird, optimieren (falls du Apache benutzt). Diese Dateien sind nicht standardmässig aktiviert, weil ein paar Hosts Fehler anzeigen würden. Falls dir das passieren sollte, nachdem du die Dateien umbenannt hast, entferne sie einfach wieder (bzw nenne sie wieder um) und alles ist gut.',
'By default, blogs are displayed using a skin. (More on skins in another post.)\n\nThis means, blogs are accessed through \'<code>index.php</code>\', which loads default parameters from the database and then passes on the display job to a skin.\n\nAlternatively, if you don\'t want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided \'<code>a_stub.php</code>\' and call your blog through this stub instead of index.php .\n\nFinally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided \'<code>a_noskin.php</code>\'.\n\nIf you want to integrate a b2evolution blog into a complex website, you\'ll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.\n\nYou will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.\n\nEither way, make sure you go to the blogs admin and set the correct access method for your blog. When using a stub or a template, you must also set its filename in the \'Stub name\' field. Otherwise, the permalinks will not function properly.' => 'Standardmässig werden alle vorinstallierten Blogs durch ein Skin dargestellt. (Mehr zu Skins in einem anderen Eintrag.)

Das heisst, Blogs werden durch \'<code>index.php</code>\' aufgerufen, wo Datenbank-Voreinstellungen geladen werden und dann wird der Job des Anzeigens an das Skin übergeben.

Alternativ, falls du keine Datenbank-Voreinstellungen benutzen willst, um, sagen wir, ein Skin, eine Kategorie oder spezielles Linkblog zu erzwingen, kannst du eine Stub-Datei wie die mitgelieferte \'<code>a_stub.php</code>\' erstellen und dein Blog durch diesen Stub aufrufen, anstelle von index.php .

Schliesslich, falls du sehr spezielle Anpassungen deines Blogs brauchst, kannst du schlichte Vorlagen anstellen von Skins benutzen. In diesem Fall rufe dein Blog durch eine vollständige Vorlage wie die mitgelieferte \'<code>a_noskin.php</code>\' auf.

Du wirst in den Stub/Vorlagen-Dateien selber weitere Informationen finden. Öffne sie in einem Texteditor und lies die Kommentare darin.

Wie auch immer, gehe sicher im Blog-Adminbereich die richtige Zugriffsart festzulegen. Wenn du eine Stub- oder Vorlagendatei benutzt, musst du auch einen Dateinamen im \'Stub-Name\'-Feld angeben. Ansonsten werden Permalinks nicht richtig funktionieren.',
'Skins, Stubs, Templates &amp; website integration...' => 'Skins, Stubs und Vorlagen...',
'About widgets...' => 'Über evoSkins...',
'About skins...' => 'Über evoSkins...',
'By default, b2evolution blogs are displayed using a skin.\n\nYou can change the skin used by any blog by editing the blog settings in the admin interface.\n\nYou can download additional skins from the <a href="http://skins.b2evolution.net/" traget="_blank">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on "Install new".\n\nYou can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.\n\nTo start customizing a skin, open its "<code>_main.php</code>" file in an editor and read the comments in there. And, of course, read the manual on skins!' => 'Standardmässig werden b2evolution Blogs durch ein Standard-Skin angezeigt.

<p>Leser können durch einen Skin-Wechsler (der in den meisten Skins integriert ist) ein anderes Skin auswählen.

Du kannst das Standard-Skin für jedes Blog ändern, indem du die Blog-Parameter im Adminbereich änderst. Du kannst ausserdem auch ein bestimmtes Skin für alle Benutzer erzwingen.

Ansonsten kannst du verfügbare Skins einschränken, indem du welche aus dem Verzeichnis /blogs/skins löschst. Du kannst auch neue Skins erstellen, indem du vorhandene Skin-Verzeichnisse duplizierst, umbenennst und anpasst.

Um mit dem Anpassen eines Skins zu beginnen, öffne dessen \'<code>_main.php</code>\' Datei in einem Editor (bevorzugt mit einem der PHP/HTML-Syntax kennt und hervorhebt) und lies die Kommentare dort. Ausserdem solltest du die Anleitung zu evoSkins lesen!',
'This is a multipage post' => 'Dies ist ein mehrseitiger Eintrag',
'This is page 1 of a multipage post.\n\nYou can see the other pages by clicking on the links below the text.\n\n<!--nextpage-->\n\nThis is page 2.\n\n<!--nextpage-->\n\nThis is page 3.\n\n<!--nextpage-->\n\nThis is page 4.\n\nIt is the last page.' => 'Dies ist Seite 1 eines mehrseitigen Eintrags.

Du kannst die anderen Seiten sehen, indem du auf die Links unter dem Text klickst.

<!--nextpage-->

Dies ist Seite 2.

<!--nextpage-->

Dies ist Seite 3.

<!--nextpage-->

Dies ist Seite 4.

Dies ist die letzte Seite.',
'Extended post with no teaser' => 'Erweiterter Eintrag ohne Teaser',
'This is an extended post with no teaser. This means that you won\'t see this teaser any more when you click the "more" link.\n\n<!--more--><!--noteaser-->\n\nThis is the extended text. You only see it when you have clicked the "more" link.' => 'Dies ist ein erweiterter Eintrag ohne Teaser. Das heisst du wirst den Lockartikel (Teaser) nicht mehr sehen, wenn du auf den "mehr"-Link klickst.

<!--more--><!--noteaser-->

Dies ist der erweiterte Text. Du siehst ihn nur, wenn du auf den "mehr"-Link geklickt hast.',
'Extended post' => 'Erweiterter Eintrag',
'This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.\n\n<!--more-->\n\nThis is the extended text. You only see it when you have clicked the "more" link.' => 'Dies ist ein erweiterter Eintrag. Das bedeutet, du siehst erst nur diesen kleinen Lockartikel (Teaser) und musst auf den unteren Link klicken, um mehr zu sehen.

<!--more-->

Dies ist der erweiterte Text. Du siehst ihn nur, wenn du auf den "mehr"-Link geklickt hast.',
